fun isIsomorphic(s: String, t: String): Boolean {

    if(s.length != t.length) return false

    return transformation(s).equals(transformation(t))
}

fun transformation(s: String): String {

    val hashMap = hashMapOf<Char, Int>()
    val chain = StringBuilder()

    s.forEachIndexed { index, value ->

        hashMap.putIfAbsent(value, index)

        chain.append(hashMap[value]).append(" ")

    }
    return chain.toString()
}// end fun transformation()